import React from "react";
import {BsInfoCircleFill} from 'react-icons/bs'
import PageHeaderContent from "../PageHeader";
import img1 from "../../images/proj_mgmnt.avif";
import img2 from "../../images/web_boot.jpg";
import img3 from "../../images/mozilla.png";
import img4 from "../../images/ts.png";
import './styles.scss';

const projectsData =[
    {
        id:1,
        name: "Project Management App",
        image: img1
    },
    {
        id:2,
        name: "Web Bootcamp projects",
        image: img2
    },
    {
        id:3,
        name: "Mozilla Splash",
        image: img3
    },
    {
        id:4,
        name: "TypeScript",
        image: img4
    }
]

 const filterData = [
    {
        filterId : 1,
        label : "All"
    },
    {
        filterId : 2,
        label : "Development"
    },
    {
        filterId : 3,
        label : "Design"
    }
]

const Project = () => {
    return(
        <section id="project" className="project">
            <PageHeaderContent
            headerText="My Projects"
            icon={<BsInfoCircleFill size={40} />}
            />
            <div className="project__content">
                <ul className="project__content__filter">
                    {
                        filterData.map(item => (
                            <li key={item.filterId}>

                                {
                                    item.label
                                }
                            </li>
                        ))
                    }

                </ul>
                <div className="project__content__cards">
                    {
                        projectsData.map(item => (
                            <div key={item.id} className="project__content__cards__item">
                               <div ></div>
                            </div>
                        ))
                    }
                </div>
            </div>
        </section>
    )
}

export default Project;
